      "人行贵阳中心支行坚持创新驱动发展的工作理念，引导金融机构科学、合理地开展金融扶贫创新。该行围绕“用好、用足、用规范”三个核心，创新运用扶贫再贷款工具，探索出“一次授信，循环使用”“再贷款资金+匹配自有信贷资金”杠杆化运作等模式。截至2018年年末，全省扶贫再贷款余额达331亿元，同比增长37.6%。",
      "人行贵阳中心支行创新运用金融科技，成功搭建“贵州省区块链农权抵押贷款系统”，将抵押登记时间缩短至1个工作日，促进贫困地区开展农权融资，全省“两权”抵押贷款同比增长81.2%；创新工作激励机制，对金融扶贫政策效果评估结果优异的金融机构给予扶贫再贷款奖励。",

      "人行贵阳中心支行坚持问题导向，抓住扶贫重点及难点，引导金融资源精准注入。该行聚焦深度贫困地区，落实好金融支持深度贫困地区脱贫攻坚行动方案，并单列90亿元扶贫再贷款规模。",
      "人行贵阳中心支行指导相关金融机构做好搬迁项目贷款的发放和管理，指导金融机构在搬迁安置点设立500余个金融服务站，引导其创新“迁户贷”“宜居贷”“安居贷”等49个金融产品。",
      "人行贵阳中心支行聚焦扶贫产业，构建多层次金融支持体系。该行引导金融机构创新“一县一业”产业扶贫贷款，举行全省农业产业化银企对接会。",

