      "人行贵阳中心支行打造贫困户评级授信模式，提升诚信占比，下调资产占比，支持有就业能力、有发展意愿的贫困户评得了级，贷得上款。该行建立金融知识普及宣传长效机制，各级人行组织金融机构采取“金融夜校”“农民脱贫讲习所”等方式，解读金融扶贫政策",

